contracts/vaccineHelper.sol.content:
pragma solidity ^0.4.19;

import "./vaccineFactory.sol";

contract VaccineHelper is VaccineFactory {

    modifier onlyOwnerOf(uint _vaccineID) {
        require(msg.sender == vaccineToOwner[_vaccineID]);
        _;
    }

    modifier aboveCures(uint _cures, uint _vaccineID) {
        require(vaccines[_vaccineID].cures >= _cures);
        _;
    }

    uint powerUpFee = 0.001 ether;

    function withdraw() external onlyOwner {
        owner.transfer(this.balance);
    }

    function setPowerUpFee(uint _fee) external onlyOwner {
        powerUpFee = _fee;
    }

    function powerUp(uint _vaccineID) external payable {
        require(msg.value == powerUpFee);
        vaccines[_vaccineID].power++;
    }

    function changeName(uint _vaccineID, string _newName) external aboveCures(2, _vaccineID) onlyOwnerOf(_vaccineID) {
        vaccines[_vaccineID].name = _newName;
    }

    function changeRna(uint _vaccineID, uint _newRna) external aboveCures(20, _vaccineID) onlyOwnerOf(_vaccineID) {
        vaccines[_vaccineID].rna = _newRna;
    }

    function getVaccinesByOwner(address _owner) external view returns(uint[]) {
        uint[] memory result = new uint[](ownerVaccineCount[_owner]);
        uint counter = 0;
        for (uint i = 0; i < vaccines.length; i++) {
            if (vaccineToOwner[i] == _owner) {
                result[counter] = i;
                counter++;
            }
        }
        return result;
    }
}

contracts/vaccineFactory.sol.content:
pragma solidity ^0.4.19;

import "./ownable.sol";

contract VaccineFactory is Ownable{
    event newVaccine(uint vaccineID, string name, uint rna);
    uint rnaDigits = 16;
    uint rnaModulus = 10 ** rnaDigits;

    address owner;

    function VaccineFactory() {
        owner = msg.sender;
    }

    struct Vaccine {
        string name;
        uint rna;
        uint power;
        uint cures;
    }

    Vaccine[] public vaccines;

    mapping (uint => address) public vaccineToOwner;
    mapping (address => uint) ownerVaccineCount;

    function _createVaccine(string _name, uint _rna) internal {
        uint id = vaccines.push(Vaccine(_name, _rna, 1, 0)) - 1;
        vaccineToOwner[id] = msg.sender;
        ownerVaccineCount[msg.sender]++;
        newVaccine(id, _name, _rna);
    }

    function _generateRandomRna(string _str) private view returns (uint) {
        uint rand = uint(keccak256(_str));
        return rand % rnaModulus;
    }

    function createRandomVaccine(string _name) public {
        require(ownerVaccineCount[msg.sender] == 0);
        uint randRna = _generateRandomRna(_name);
        randRna = randRna - randRna % 100;
        _createVaccine(_name, randRna);
    }

    function kill() public {
        if (owner == msg.sender) {
            selfdestruct(owner);
        }
    }

}

contracts/ownable.sol.content:
pragma solidity ^0.4.19;

contract Ownable {
    address public owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);


    function Ownable() public {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0));
        OwnershipTransferred(owner, newOwner);
        owner = newOwner;
    }

}

